import React, { Component } from 'react';

class Signup extends Component{
	state = {
		'btnType':'password'
	}
	showPassword=()=>{
		if(this.state.btnType=='text') this.setState({'btnType':'password'});
		else this.setState({'btnType':'text'});
	}
	render(){
		return(
			<div>
				<form className='form-group'>

					<label>Username :</label>
					<input type='text' 
					className='form-control' 
					placeholder='e.g. sumit123'
					/><br/>

					<label>First Name :</label>
					<input type='text' 
					className='form-control' 
					placeholder='e.g. Sumit'
					/><br/>

					<label>Last Name :</label>
					<input type='text' 
					className='form-control' 
					placeholder='e.g. Dhakad'
					/><br/>

					<label>Email :</label>
					<input type='email' 
					className='form-control' 
					placeholder='e.g. sumitdhakad123@gmail.com'
					/><br/>

					<label>Password :</label>
					<input type={this.state.btnType} 
					className='form-control' 
					placeholder='Make strong password.'
					/>
					<h1 
					onClick = {this.showPassword}
					className='btn btn-danger btn-sm'
					>Show</h1><br/>

					<label>Confirm password :</label>
					<input type={this.state.btnType} 
					className='form-control' 
					placeholder='Both password should be same.'
					/><br/>
					<input type='submit' 
					className='btn btn-success m-2 form-control' 
					value='SIGNUP'
					/>
				</form>
			</div>
		);
	}
}

export default Signup;
